    XW += x[46]*42.017250; /*NCO */
    XW += x[47]*28.013400; /*N2 */
    XW += x[48]*39.948000; /*AR */
    XW += x[49]*43.089240; /*C3H7 */
    XW += x[50]*44.097210; /*C3H8 */
    XW += x[51]*43.045610; /*CH2CHO */
    XW += x[52]*44.053580; /*CH3CHO */
    XW += x[53]*20.006370; /*HF */
    XW += x[54]*18.998400; /*F */
    XW += x[55]*37.996800; /*F2 */
    XW += x[56]*34.033460; /*CH3F */
    XW += x[57]*52.023890; /*CH2F2 */
    XW += x[58]*70.014320; /*CHF3 */
    XW += x[59]*88.004750; /*CF4 */
    XW += x[60]*33.025490; /*CH2F */
    XW += x[61]*51.015920; /*CHF2 */
    XW += x[62]*69.006350; /*CF3 */
    XW += x[63]*32.017520; /*CHF */
    XW += x[64]*50.007950; /*CF2 */
    XW += x[65]*31.009550; /*CF */
    XW += x[66]*85.005750; /*CF3O */
